import React from 'react';
import './sidebar.css';
import SidebarOption from './SidebarOption';
import ForumIcon from '@material-ui/icons/Forum';
import SpeakerNotesIcon from '@material-ui/icons/SpeakerNotes';
import SupervisorAccountIcon from '@material-ui/icons/SupervisorAccount';
import AdbIcon from '@material-ui/icons/Adb';
import SettingsIcon from '@material-ui/icons/Settings';
import AssessmentIcon from '@material-ui/icons/Assessment';

function Sidebar() {
    return (
        <div className="sidebar__main">
            <div className="sidebar__header">
                <h2>BigRadar</h2>
                <h3>Project Name</h3>
            </div>
            <SidebarOption Icon={ForumIcon} title={'Conversation'} />
            <SidebarOption Icon={SpeakerNotesIcon} title={'Campaigns'} />
            <SidebarOption Icon={SupervisorAccountIcon} title={'Users'} />
            <SidebarOption Icon={AdbIcon} title={'Bots'} />
            <SidebarOption Icon={SettingsIcon} title={'Settings'} />
            <SidebarOption Icon={AssessmentIcon} title={'Reports'} />
        </div>
    )
}

export default Sidebar
